// Start of Scheduling Logic Instructions
// The schedule logic can handle turning on/off Bulbs, Groups, and Switches based on specific time of day or based on sunset/sunrise.
// To help illustrate the flexibility of the schedule logic, three schedules are included first -- one for updating a group, one for
// updating a specific light bulb, and one for updating a binary switch. I've included a lot of example schedules as well, so you can
// peruse the examples below to come up with your own schedules.
//
// **Note - check out the example on line 127 for an example of a schedule which is only triggered on weekdays. 
// 
// If you want to have any of your schedules be triggered by Sunset or Sunrise, use the following variables --
// Sunrise: if(hours==context.global.Weather.SunriseHour && minutes==context.global.Weather.SunriseMin){ actions }
// Sunset: if(hours==context.global.Weather.SunsetHour && minutes==context.global.Weather.SunsetMin){ actions }
// Note: You can also offset Sunset/Sunrise by simply adding or subtracting from the value as seen below.

// Here is an example of a group being updated based on Sunset. Note that the Sunset hour is offset by 1 hour. This means the lights come on one hour before
// sunset when it's more "dusk" than dark.
if(hours==(context.global.Weather.SunsetHour-1) && minutes==context.global.Weather.SunsetMin) // Indoor Lights at Dusk
{
    // Note this is updating a group - thus the next line is newMsg.payload.group_name
    // if we were updating a light bulb, it should be newMsg.payload.light_bulb
    // if we were updating a switch, it should be newMsg.payload.binary_switch
    newMsg.payload.group_name="Family and Living"; // In this case, we're triggering a group. Put in your group's name here.
    newMsg.payload.powered=true; // True for on, False for off.
    newMsg.payload.brightness=1.0; // Bulb brightness is from 0.0 (dim) to 1.0 (full brightness)
    newMsg.payload.action="group"; // This is used in the next step of the flow. Your options are either "group" "lightbulb" or "switch"
    newMsg.payload.trigger="Schedule: Indoor Lights on at Dusk"; // This text is used in a push bullet message later in the flow.
}


// Next we have an example of a single light bulb being updated at a specific time.
// If you have multiple objects which you want to turn on at 5am, for example, stagger them 1 minute apart.
// e.g. Lightbulb1 on at 5:01, group2 on at 5:02, switch off at 5:03.
// You **cannot** have multiple objects triggered at the same time.
if(hours==5 && minutes==03) //Family Ceiling Light on @ 5am
{
    // Since this is a light bulb being triggered, note it's newMsg.payload.light_bulb
    // if it were a group, we'd want newMsg.payload.group_name
    // if it were a switch, we'd want newMsg.payload.binary_switch
    newMsg.payload.light_bulb="Family room ceiling"; // Put your light bulb's name in here
    newMsg.payload.powered=true; // true for on, false for off
    newMsg.payload.brightness=0.5; // I'm only turning the bulb on to 50% brightness, thus 0.5. 0.0 is fully dim, 1.0 is full brightness.
    newMsg.payload.action="lightbulb"; // This is used in the next step of the flow. Your options are either "group" "lightbulb" or "switch"
    newMsg.payload.trigger="Schedule: Family room Ceiling Light on at 5am"; // This text is used in a push bullet message later in the flow.
}

// Lastly, we have an example of a z-wave switch being updated at a specific time.
if(hours==5 && minutes==35) //Aquarium Light On
{
    // Again, since this is a switch being triggered, it's newMsg.payload.binary_switch
    // if it were a group we wanted to update, we'd want newMsg.payload.group_name
    // if it were an individual light bulb we wanted to update, we'd want newMsg.payload.light_bulb
    newMsg.payload.binary_switch="Aquarium Light"; // Enter the switch's name from Wink app.
    newMsg.payload.powered=true; // true for on, false for off.
    newMsg.payload.action="switch"; // This is used in the next step of the flow. Your options are either "group" "lightbulb" or "switch"
    newMsg.payload.trigger="Schedule: Aquarium on at 5:35am"; // This text is used in a pushbullet message later in the flow.
}


// Here is a group named Garage which is turned on exactly at sunset.
if(hours==(context.global.Weather.SunsetHour) && minutes==context.global.Weather.SunsetMin) // Garage Lights at Sunset
{
    newMsg.payload.group_name="Garage";
    newMsg.payload.powered=true;
    newMsg.payload.brightness=0.0;
    newMsg.payload.action="group";
    newMsg.payload.trigger="Schedule: Garage Lights on at Sunset";
}

// Here the group named Garage is turned off 1 hour after sunrise. I felt like sunrise was still kinda dark, so I wanted the
