{
    newMsg.payload.light_bulb="Angie family room";
    newMsg.payload.powered=true;
    newMsg.payload.brightness=1.0;
    newMsg.payload.action="lightbulb";
    newMsg.payload.trigger="Schedule: Angie's Light on at 5am";
}

// Here is a little more complex example -- I have a group which is only turned on during the week days.
